import React from "react";
import Habit from "./Habit/Habit";
import { FaChevronRight } from "react-icons/fa";

const habits = [
  "Sleep & Recovery",
  "Occupation & Focus",
  "Physical Activity & Breathwork",
  "Nutrition & Digestion",
];

export default function Habits() {
  return (
    <div>
      {habits.map((habit, i) => {
        return <Habit title={habit} habicon={habicons[i]} />;
      })}
    </div>
  );
}
